import faceMalin from "./faceMalin.JPG";
import "./App.css";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        <header className="App-header">
          <img src={faceMalin} alt="logo" className=" App-logo img-fluid" />
          <p>hello</p>
        </header>
      </div>
    </div>
  );
}
